import './App.css';

const App = () => {
    const API_URL = `http://aleksanderblaszkiewicz.pl/callendar/get_events.php`;
    const [events, setEvents] = useState([]);

    useEffect(() => {
        fetch(API_URL)
        .then((response) => response.json())
        .then((data) => console.log(data))
        .then((data) => setEvents(data));
    }, []);

    return  (
        <>
            <div className="App">
                <h1>Kalendarz</h1>
                {events.map(event => (
                    <Card />
                ))};
            </div>
        </>
    )
}

export default App;
